<!DOCTYPE html>
<html>
  <head>
    <title></title>
  </head>
  <body>Invalid Path</body>
  <script>
    var name = window.location.pathname
    var split_name = name.split('/')
    var temp = split_name[split_name.length-1]
    if (temp != ''){
      sessionStorage.setItem('temp', temp)
    }
    window.location.href = 'https://himitsuconfidential.github.io/encryption/'
  </script>
</html>
